  \"Discovering Anomalous Aviation Safety Events Using Scalable Data Mining Algorithms\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 9,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:04:20.070081\",\n\t\"name\": \"discovering-anomalous-aviation-safety-events-using-scalable-data-mining-algorithms\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The worldwide civilian aviation system is
  one of the most complex dynamical systems created. Most modern commercial aircraft
  have onboard flight data recorders that record several hundred discrete and continuous
  parameters at approximately 1Hz for the entire duration of the flight. These data
  contain information about the flight control systems, actuators, engines, landing
  gear, avionics, and pilot commands. In this paper, recent advances in the development
  of a novel knowledge discovery process consisting of a suite of data mining techniques
  for identifying precursors to aviation safety incidents are discussed. The data
  mining techniques include scalable multiple-kernel learning for large-scale distributed
  anomaly detection. A novel multivariate time-series search algorithm is used to
  search for signatures of discovered anomalies on massive datasets. The process can
  identify operationally significant events due to environmental, mechanical, and
  human factors issues in the high-dimensional flight operations quality assurance
  data. All discovered anomalies are validated by a team of independent domain experts.
  This novel automated knowledge discovery process is aimed at complementing the state-of-the-art
  human-generated exceedance-based analysis that fails to discover previously unknown
  aviation safety incidents. In this paper, the discovery pipeline, the methods used,
  and some of the significant anomalies detected on real-world commercial aviation
  data are discussed.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
